    [],nt"num_tags": 5,nt"name": "stillwater-wildlife-management-area-annual-water-management-plan-f9452",nt"isopen":
    false,nt"url": null,nt"notes": "The primary goal of the annual water plan
    is to set a strategy for the most  efficient use of the available water delivered
    to Stillwater WMA. For all practical purposes, Fallon NWR no longer receives sufficient
    water from the Carson River to maintain any quality wetlands. Effects of the final
    Operating Criteria and Procedures (OCAP) and the 1987 and 1988 drought in Western
    Nevada have combined to seriously reduce flows to the WMA. A 100% water year is
    forecast for on-farm delivery but tight water management with a minimum of drain
    water flow is expected with a projected 32,500 AF delivery to Stillwater WMA. This
    is the 1980 plan.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
